import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import AdminNavigation from '../../components/AdminNavigation';
import Button from '@material-ui/core/Button';
import {Container} from '@material-ui/core';
import {Row,Col,Image} from 'react-bootstrap';
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles({
  root: {
    maxWidth: 800,
   marginLeft:300,

  },
});

export default function ImgMediaCard() {
  const classes = useStyles();

  return (
<Container>
  <AdminNavigation />
    <Card className={classes.root} style={{marginBottom:50}}>
        <CardMedia
          component="img"
          alt="Contemplative Reptile"
          height="140"
          image="https://images.pexels.com/photos/5412/water-blue-ocean.jpg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940"
          title="Contemplative Reptile"
        />
        
        <CardContent>
        <Row>
         <Col xl={4}>
       <Image src="https://hairstylecamp.com/wp-content/uploads/short-businessmen-haircut.jpg"
        roundedCircle
       style={{width:130,height:130, marginTop:-100,marginLeft:30}}
       />
       <Card style={{marginTop:50}}>
         <CardContent>

         </CardContent>
       </Card>
         </Col>
         <Col xl={8}>
           <Card>
           <CardContent >
             <p>FullName:</p><hr />
             <p>Admin-ID:</p><hr />
             <p>Password:</p><hr />
             <p>Email:</p><hr />
             <p>Phone#:</p><hr />
             <p>Profession:</p><hr />
             <p>Gender:</p><hr />
             <p>Age:</p><hr />
             <p>DOB:</p><hr />
             <p>City:</p><hr />
             <p>Nationality:</p>
             

             </CardContent>


           </Card>


         </Col>
         </Row>
        </CardContent>
        
      <CardActions>
        <Button size="small" color="primary">
          Learn More
        </Button>
      </CardActions>
    </Card>
    </Container>
  );
}
